import mongoose from "mongoose";
import bcrypt from 'bcrypt';
import jwt from 'jsonwebtoken';
import { UserSchema } from '../models/userModel';

const User = mongoose.model('User', UserSchema);

 export const loginRequired = (req, res, next) => {
    if (req.user) {
        next();
    }else{
        return res.status(401).json({ message: 'Unauthorized user' });
    }
 }

 export const register = async (req, res) => {
    try {
        const newUser = new User(req.body);
        newUser.hashPassword = bcrypt.hashSync(req.body.password, 10);
        
        const savedUser = await newUser.save();

        savedUser.hashPassword = undefined;

        return res.json(savedUser);
    } catch (err) {
        console.error(err);
        return res.status(400).json({ message: err.message || 'Registration failed' });
    }
};

 export const login = async (req, res) => {
    try {
        const user = await User.findOne({ email: req.body.email });

        if (!user) {
            return res.status(401).json({ message: 'Authorization Failed. No user found' });
        }

        if (!user.comparePassword(req.body.password, user.hashPassword)) {
            return res.status(401).json({ message: 'Authorization Failed. Wrong password' });
        }

        return res.json({
            token: jwt.sign({ email: user.email, username: user.username, _id: user.id }, 'RESTFULAPIs'),
        });
    } catch (err) {
        console.error(err);
        return res.status(500).json({ message: 'Internal Server Error' });
    }
};

